description.Description:
Maximum likelihood estimation of the parameters of a fractionally
   differenced ARIMA(p,d,q) model (Haslett and Raftery, Appl.Statistics, 1989);
   including inference and basic methods.  Some alternative algorithms to estimate "H".

A collection of tests, data sets, and examples
 for diagnostic checking in linear regression models. Furthermore,
 some generic tools for inference in parametric models are provided.

User-friendly general package providing standard methods for meta-analysis and supporting Schwarzer, Carpenter, and Rücker <DOI:10.1007/978-3-319-21416-0>, "Meta-Analysis with R" (2015):
 - common effect and random effects meta-analysis;
 - several plots (forest, funnel, Galbraith / radial, L'Abbe, Baujat, bubble);
 - three-level meta-analysis model;
 - generalised linear mixed model;
 - logistic regression with penalised likelihood for rare events;
 - Hartung-Knapp method for random effects model;
 - Kenward-Roger method for random effects model;
 - prediction interval;
 - statistical tests  for funnel plot asymmetry;
 - trim-and-fill method to evaluate bias in meta-analysis;
 - meta-regression;
 - cumulative meta-analysis and leave-one-out meta-analysis;
 - import data from 'RevMan 5';
 - produce forest plot summarising several (subgroup) meta-analyses.

